const TotalBudget = ({ totalBudget, remainingBudget }) => {
  return (
    <div className="budget-container">
      <h2>Total Budget: ₹{totalBudget}</h2>
      <h3>Remaining Budget: ₹{remainingBudget}</h3>
    </div>
  );
};

export default TotalBudget;
